window.bookSummaryJSON = "<p><b>They brought death to my doorstep. Now, I’ll bring it to theirs.</b></p> <p>I’m in over my head. There is no denying it anymore. The Skew War is real, and I’m smack in the middle of it. Moreover, after what they did to my friend, there is no getting out of it. Anyone who messes with the people I love messes with me, and they’ll pay for it. </p> <p>My new powers are taking shape, and I’m willing to learn everything Eric Cross has to teach me to defeat our enemies.</p> <p>But when hybrids ambush us, we learn Bernadetta Fiore and Stephen Erickson went further than we’d anticipated. We thought we’d prevented them from creating the vile monsters, but we were wrong, and their existence changes everything. </p> <p>As if all of this weren’t enough, Jake and I are still trying to figure out a way to break up his engagement, my agency is hanging by a thread, and a Midnight Witch has joined our foes. </p> <p>My life is chaos. </p> <p>Jake and I can’t be together. </p> <p>Revenge might be all I have left, once this is all said and done.</p> <p><b>If you enjoy K.F. Breene, Shannon Mayer, Annette Marie, and C.N. Crawford, then step into a conspiracy where you don’t know whom to trust. </b></p>"; 
